import React from 'react';
import { Link } from 'react-router-dom';
import './FormStyles.css'; // Import the CSS file

const Login = () => {
  return (
    <div className="form-container"> {/* Apply form-container class */}
      <h2 className="title">Login</h2> {/* Apply title class */}
      {/* Login Form */}
      <form className="fuel-quote-form"> {/* Apply fuel-quote-form class */}
        <div className="form-group">
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" className="retrieve-address" /> {/* Apply retrieve-address class */}
        </div>
        <div className="form-group">
          <label htmlFor="password">Password:</label>
          <input type="password" id="password" className="retrieve-address" /> {/* Apply retrieve-address class */}
        </div>
        <div className="form-group">
          <button type="submit">Login</button>
        </div>
      </form>
      {/* Register Button */}
      <div className="center">
        <Link to="/register">Register</Link>
      </div>
    </div>
  );
};

export default Login;
